// src/Title.js

import React from 'react'
import logo1 from './logo.png'
import './Title.css'

function Title() {
  return (
    <div className="title">
       
           <a href="index.js"> <img src={logo1} className="logo" alt=""/> </a>
            
        
        
      <h1>Uploader</h1>
     
    </div>
    
  )
}

export default Title
